import { createSlice, PayloadAction } from "@reduxjs/toolkit";

interface Category {
	id: number | string;
	name: string;
}

interface Price {
	value: number;
	enabled: boolean;
}

export interface Item {
	id: number;
	quantity: number;
	name: string;
}

interface AddListing {
	id?: number | string;
	items?: Item[];
	title?: string;
	category?: Category;
	subCategory?: Category;
	fieldValues?: {
		name: string;
		fieldType: "single" | "multiple";
		selectedValues: Category[];
	}[];
	description?: string;
	images?: { id: string | null; url: string; fileName: string; type: string }[];
	currency?: { name: string; symbol: string };
	price1Day?: Price;
	price3Days?: Price;
	price7Days?: Price;
	price30Days?: Price;
	buyPrice?: number;
	condition?: string;
	type?: string[];
	perks?: {
		buyNow: boolean;
		freeShipping: boolean;
		makeOffer: boolean;
		pickup: boolean;
		shipping: boolean;
		terms: boolean;
	};
}

const initialState: AddListing = {
	id: "",
	items: [],
	title: "",
	category: { id: "", name: "" },
	subCategory: { id: "", name: "" },
	fieldValues: [],
	description: "",
	images: [],
	currency: { name: "NGN", symbol: "N" },
	price1Day: { value: 0, enabled: false },
	price3Days: { value: 0, enabled: false },
	price7Days: { value: 0, enabled: false },
	price30Days: { value: 0, enabled: false },
	buyPrice: 0,
	condition: "",
	type: [],
	perks: {
		buyNow: false,
		freeShipping: false,
		makeOffer: false,
		pickup: false,
		shipping: false,
		terms: false,
	},
};

const addListingSlice = createSlice({
	name: "newListing",
	initialState,
	reducers: {
		updateNewListing: (state, action: PayloadAction<Partial<AddListing>>) => {
			Object.assign(state, action.payload);
		},
		clearNewListing: state => {
			Object.assign(state, initialState);
		},
	},
});

export default addListingSlice.reducer;
export const { updateNewListing, clearNewListing } = addListingSlice.actions;

